import './post.css'

const Post = () => {
  return (
    <div className='post'>
      <div className="postWrapper">
        <div className="postTop"></div>
        <div className="postCenter"></div>
        <div className="postBottom"></div>
      </div>
    </div>
  )
}

export default Post
